import React, {useState} from "react";

export const addBook = (e) =>{
    const [data, setData] = useState("");
    e.preventDefault()
    const book ={data}
    fetch ('api/books/add',{
        method:"POST",
        headers:{"Content-Type":"application/json"},
        body:JSON.stringify(book)
    }).then(()=>{
        console.log("Новая книга добавлена")
    })
}
